import React from "react";
import PopupButton from "./PopupButton";

function TripsCardsItems(props) {
  return (
    <>
      <li className="trips__cards__item">
        <div className="trips__cards__item__link" to={props.path}>
          <figure className="trips__cards__item__pic-wrap">
            <img className="trips__cards__item__img" alt="d" src={props.src} />
          </figure>
          <div className="trips__cards__item__info">
            <h5 className="trips__cards__item__date">{props.label}</h5>
            <h5 className="trips__cards__item__text">{props.text}</h5>
          </div>
          <PopupButton />
        </div>
      </li>
    </>
  );
}

export default TripsCardsItems;
